import React from 'react';
import './Style.css';

function Navbar() {
  return (
    <nav class="navbar navbar-expand-dark navbar-light bg-light">
      <ul>
        <il>
          <a className='nav item' href='#'>Hello</a>
        </il>
      </ul>
    </nav>
  );
}

export default Navbar;
